class stock_info:
    def __init__(self, ticker_dict, dataset_name):
        self.dataset_name = dataset_name
        self.stocks = {}
        self.company_names = []
        for symbol, name in ticker_dict.items():
            self.stocks[symbol] = yf.Ticker(symbol)
            self.company_names.append(name)
        self.symbol_name_dict = ticker_dict
        self.full_data_series = {}
        self.start_date = None
        self.end_date = None
        self.cols = ['Open', 'High', 'Low', 'Close', 'Volume']
        self.roberta_encoder = RobertaEncoder().to('cuda:0')
    
    def get_prices(self, interval, start, end, date_coupled=False):
        data = {}
        if not date_coupled:
            for symbol, ticker in self.stocks.items():
                data[symbol] = torch.tensor(ticker.history(interval=interval,
                                      start=start, end=end).loc[:, self.cols].values)
        else:
            for symbol, ticker in self.stocks.items():
                data[symbol] = ticker.history(interval=interval,
                                      start=start, end=end).loc[:, self.cols]
        return data
    
    def get_company_text_info(self):
        data = {}
        with torch.no_grad():
            i = 0
            for symbol, ticker in self.stocks.items():
                #data[symbol] = [ticker.earnings_forecasts, ticker.]
                i += 1                #print(d)
                try:
                    d = ticker.info['sector'] + ', '+ ticker.info['industry'] + '. ' +ticker.info['longBusinessSummary']
                    data[symbol] = self.roberta_encoder(d)
                except Exception as e:
                    print(symbol, e)
                    pass
                print(f'\rIterations: {i}/{len(self.stocks)}', end='')
                # 768 dim
        return data

    def get_quarterly_financial_info(self):
        data = {}
        for symbol, ticker in self.stocks.items():
            data[symbol] = [ticker.quarterly_financials.values, ticker.quarterly_balancesheet, ticker.quarterly_cashflow]
        return data
    
    def get_company_sectors(self):
        data = {}
        i = 0
        for symbol, ticker in self.stocks.items():
                i += 1                
                try:
                    d = [ticker.info['sector'], ticker.info['industry']]
                except Exception as e:
                    pass
                print(f'\rIterations: {i}/{len(self.stocks)}', end='')
                data[symbol] = d
        a = list(data.values())
        print(a[0:20])
        save_pickle(data, f'{self.dataset_name}_sector_dict')

    def get_news(self, start, end, num):
        # (year, month, day)
        data = {}
        i = 0
        for symbol, name in self.symbol_name_dict.items():
            i += 1
            data[symbol] = [[article['title']] for article in GNews(start_date=start,end_date=end,max_results=num).get_news(f'{name}')]
            #data[symbol] = self.light_encoder(data[symbol])
            print(f"\rArticles loaded: {i}, {len(data[symbol])}", end='')
        return data
    
    def get_general_news(self, start, end, num):
        data = []
        data.append([a['title'] for a in GNews(start_date=start, end_date=end, max_results=num).get_news('Stocks')])
        data.append([a['title'] for a in GNews(start_date=start, end_date=end, max_results=num).get_news('Business')])
        data.append([a['title'] for a in GNews(start_date=start, end_date=end, max_results=num).get_news('United States')])
        #data.append(GNews(start_date=start, end_date=end, max_results=num).get_news('World'))
        return data 
    
    def get_full_data_series(self, start, end, num_articles=4, gen_articles=21):
        self.start_date = datetime.date(start[0], start[1], start[2])
        self.end_date = datetime.date(end[0], end[1], end[2])
        i = datetime.timedelta(days=1)
        c = self.start_date
        while c <= self.end_date:
            p = self.get_prices('1d', c, c+i)
            news = self.get_news(c, c+i, num_articles)
            gen_news = self.get_general_news(c, c+i, int(gen_articles/3))
            self.full_data_series[c] = [p, news, gen_news] 
            #del p, news, gen_news
            c = c + i
        self.calculate_n_day_averages()
        self.format_data()
        self.save_data_pickle(self.full_data_series, 'fds', start, end, num_articles, gen_articles)

    def get_avg_bulk_price_series(self, period, date=datetime.date.today()):
        data = self.get_bulk_price_data_series(period)
        n_data = {}
        if period == '1w':
            _period =  datetime.timedelta(weeks=1)
        if period == '1y':
            _period =  datetime.timedelta(days=365)
        if period == '5y':
            _period = datetime.timedelta(days=5*365)
        self.start_date = date-_period
        for company, date_data in data.items():
            for date, _data in date_data.items():
                n_data[date] = [{}]
                n_data[date][0][company] = _data
        dates = list(n_data.keys())
        increments = [3,5,9,15,23,33,45,59,75,93,116,144,177,215,258,306,359]
        max_interval = datetime.timedelta(days=increments[-1])
        c = self.start_date-max_interval
        self.full_data_series = n_data
        # Initialize list for appending averages
        for item in self.full_data_series.values():
            item.append([])
        # Generate backwards data so every point in data has historical averages
        one_day = datetime.timedelta(days=1)
        while c < self.start_date:
            p = self.get_prices('1d', c, c+one_day)
            self.full_data_series[c] = [p]
            c = c+one_day
        c = self.start_date
        while c <= self.end_date:
            # If there is price data for the day
            if c in dates:
                for i in range(len(increments)):
                    low_end_date = c - datetime.timedelta(days=increments[i])
                    # Initialize ticker wise averages dict for the given intcompany_wise_price_dic = erval
                    averages = {}
                    for symbol in self.symbol_name_dict.keys():
                        # Initalize zero tensors to represent averages
                        averages[symbol] = torch.zeros([1, 5])
                    closed_days = 0
                    while low_end_date <= c:
                        # Dictionary of prices for the given day by company
                        day_prices_dic = {key : value for key, value in self.full_data_series[low_end_date][0].items()}
                        for symbol, prices in day_prices_dic.items():
                            # Check to see if there are no prices (market is closed)
                            if prices.numel() == 0:
                                closed_days +=1
                            else:
                                averages[symbol] += prices
                        closed_days = closed_days/len(day_prices_dic)
                        low_end_date += one_day
                    # Divide the sum to get the average)
                    for sum in averages.values():
                        sum /= float(increments[i]-closed_days)
                    # Add the percent deviation from averages to the current day to the existing data
                    #for symbol, prices in day_prices_dic.items():
                    #    averages[symbol] = torch.cat((averages[symbol], averages[symbol]/self.full_data_series[c][0][symbol]))
                    # Add the average to the existing data
                    self.full_data_series[c][0].append(averages) 
                    del day_prices_dic
                c += one_day 
            else:
                c += one_day
        # Delete backlogged price data
        self.full_data_series = {date: item for date, item in self.full_data_series.items() if date >= self.start_date}

    def calculate_n_day_averages(self):
        # n increases by two days every increment until 10: (3,5,9,15,23,33,45,59,75,93)
        # then it increases by 5: (108,134,165,201,242,288,339)
        # n = 17
        # Added dimensionality with averages = 17*5 = 85 
        # Added dimensionality with percentage chanage from averages = 17*5 = 85
        # Total added dimensionality = 170
        one_day = datetime.timedelta(days=1)
        increments = [3,5,9,15,23,33,45,59,75,93,116,144,177,215,258,306,359]
        max_interval = datetime.timedelta(days=increments[-1])

        c = self.start_date-max_interval
        # Initialize list for appending averages
        for item in self.full_data_series.values():
            item.append([])
        # Generate backwards data so every point in data has historical averages
        while c < self.start_date:
            p = self.get_prices('1d', c, c+one_day)
            self.full_data_series[c] = [p]
            c = c+one_day
        c = self.start_date

        ex_ticker = list(self.full_data_series[c][0].keys())
        ex_ticker = ex_ticker[0]
        while c <= self.end_date:
            # If there is price data for the day
            if self.full_data_series[c][0][ex_ticker].numel() != 0:
                for i in range(len(increments)):
                    low_end_date = c - datetime.timedelta(days=increments[i])
                    # Initialize ticker wise averages dict for the given intcompany_wise_price_dic = erval
                    averages = {}
                    for symbol in self.symbol_name_dict.keys():
                        # Initalize zero tensors to represent averages
                        averages[symbol] = torch.zeros([1, 5])
                    closed_days = 0
                    while low_end_date <= c:
                        # Dictionary of prices for the given day by company
                        day_prices_dic = {key : value for key, value in self.full_data_series[low_end_date][0].items()}
                        for symbol, prices in day_prices_dic.items():
                            # Check to see if there are no prices (market is closed)
                            if prices.numel() == 0:
                                closed_days +=1
                            else:
                                averages[symbol] += prices
                        closed_days = closed_days/len(day_prices_dic)
                        low_end_date += one_day
                    # Divide the sum to get the average)
                    for sum in averages.values():
                        sum /= float(increments[i]-closed_days)
                    # Add the percent deviation from averages to the current day to the existing data
                    #for symbol, prices in day_prices_dic.items():
                    #    averages[symbol] = torch.cat((averages[symbol], averages[symbol]/self.full_data_series[c][0][symbol]))
                    # Add the average to the existing data
                    self.full_data_series[c][0].append(averages) 
                    del day_prices_dic
                c += one_day 
            else:
                c += one_day
        # Delete backlogged price data
        self.full_data_series = {date: item for date, item in self.full_data_series.items() if date >= self.start_date}
    
    def save_data_pickle(self, data, Type, start, end, articles=0, gen_articles=0):
        title = f"{Type}_{self.dataset_name}_{start}-{end}_{articles}_{gen_articles}.pickle"
        with open(title, 'wb') as outfile:
            pickle.dump(data, outfile)
        print(f"\nSaved...{title}")
    
    def format_data(self, pick=False):
        if pick:
            with open('stock_data.pickle', 'rb') as infile:
                data = pickle.load(infile)
        else:
            data = self.full_data_series
        for date, data_list in data.items():
            # Pos 0 is day price dict
            # Pos 1 is daily company news
            # Pos 2 is general news
            # Pos 3 is augmented financial data
            augmented_price_data_list = data_list[3]
            #print(len(augmented_price_data_list), augmented_price_data_list)
            data_list.remove(augmented_price_data_list)
            for stock, prices in data_list[0].items():
                for item in augmented_price_data_list:
                    for key, value in item.items():
                        #print('\n1,', prices, item[stock])
                        if key == stock:
                            data_list[0][stock] = torch.cat(([data_list[0][stock], item[stock]]))
                data_list[0][stock] = torch.flatten(data_list[0][stock])
               # print(data_list[0][stock].shape)
    
    def get_price_data_series(self, start, end):
        self.start_date = datetime.date(start[0], start[1], start[2])
        self.end_date = datetime.date(end[0], end[1], end[2])
        i = datetime.timedelta(days=1)
        c = self.start_date
        while c <= self.end_date:
            p = self.get_prices('1d', c, c+i)
            self.full_data_series[c] = [p, 'Empty', 'Empty']
            c += i
        #self.calculate_n_day_averages()
        #self.format_data()
        self.save_data_pickle(self.full_data_series, 'pds', self.start_date, self.end_date)

