        #self.save_data_pickle(batch_data, 'bch_nor_price','-2y',f'{datetime.date.today()}','','')
        self.save_data_pickle(data, 'unnorm_price_series', f'-{period}', f'{datetime.date.today()}','','')
        return data
    
